sys_variable_value.value:
(function execute(inputs, outputs) {
  	if (inputs.success == '200') {
		outputs.city = JSON.parse(inputs.response_body).localidade;
  		outputs.comments = "Address: " + JSON.parse(inputs.response_body).logradouro + " - District: " + 					JSON.parse(inputs.response_body).bairro + " - City: " + JSON.parse(inputs.response_body).localidade + " 			- State: " + JSON.parse(inputs.response_body).uf;
    } else {
      var request = new sn_ws.RESTMessageV2();
      request.setHttpMethod("get");
      request.setEndpoint("https://viacep.com.br/ws/"+ inputs.cep +"/json/");
      response = request.execute();
      var body = response.getBody();
      outputs.city = JSON.parse(body).localidade;
      outputs.comments = "Address: " + JSON.parse(body).logradouro + " - District: " + JSON.parse(body).bairro + 
        " - City: " + JSON.parse(body).localidade + " - State: " + JSON.parse(body).uf;
      inputs.success = response.getStatusCode();
    }
  	if (inputs.success != '200') {
		outputs.city = 'Request failed';
  		outputs.comments = 'Request failed';
    }
})(inputs, outputs);

